import React from 'react';
import './App.css';
import Search from "./searchbar"; 
import Results from "./results";
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'; 


const Result = ({ match, location }) => {
  const API = 'https://hn.algolia.com/api/v1/search?query=';
  const DEFAULT_QUERY =  match.params.skill_name1; 
  return (
    <>
      <h1>Skill Name: </h1>
      <h1>Skill Name: </h1>
      {match.params.skill_name2}
      <h1>Skill Name: </h1>
      {match.params.skill_name3}

    </>
  );
};


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/" component={Search}/>
          <Route exact path="/results/:skill_name1/:skill_name2/:skill_name3" component={Result} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
